 $("#js-rotating").Morphext({
     animation: "pulse",
     separator: ",",
     speed: 2000,
     complete: function () {}
 });

 $(document).ready(function () {
     var mySwiper = new Swiper ('.swiper-container', {
       direction: 'horizontal',
       loop: true,
         slidesPerView: 3,
         paginationClickable: true,
         spaceBetween: 30,
         freeMode: true,
         scrollbar: '.swiper-scrollbar',
         scrollbarHide: true,
         grabCursor: true,
         autoplay: 2500,
         autoplayDisableOnInteraction: false
     });

     /* phone */
     $('.app-features-box').hover(function(){
         $(this).children('.app-features-box-icon').attr('style', 'color:#FF5274');
         $('#app-features-phone').attr('src', '/img/' + $(this).data('img') + '.png');
     }, function () {
         $(this).children('.app-features-box-icon').attr('style', 'color:#232731');
         $('#app-features-phone').attr('src', '/img/iphone_home.png');
     });
 });
